import React from "react";

const ContactPage = () => {
    return (
        <div>
            <header>
                <h1>Our Contacts</h1>
            </header>

            <main>
                <section>
                    <h2>Our contacts</h2>
                    <ul>
                        <li>email: alexpolyuh95@gmail.com</li>
                        <li>tel: +380637284744</li>
                        <li>Santa Comba Dao, Portugal</li>
                    </ul>
                </section>

            </main>
            <hr />
       
        </div>
    );
};

export default ContactPage;
